import '../style/Home.scss'
import logo from '../assets/images/logo.png'
import { Button } from '../components/Button/index'
import { Link } from 'react-router-dom'
import { MainAside } from '../components/MainAside'
import { FormEvent, useState } from 'react'


export function Home() {

    const [email, setEmail] = useState('')
    const [senha, setSenha] = useState('')

    fetch('https://blog.apiki.com/wp-json/wp/v2/posts?_embed&categories=518')
    .then(response => {
        console.log(response)
    })
    
    async function handleLogin(event: FormEvent){
        event.preventDefault();

        const InfoAuth = {
            'email' : email,
            'senha' : senha
        }

        console.log(InfoAuth)
    }

    return (
        <div id="page-home">
            <MainAside />

            <main id="right-content">
                <img src={logo} alt="Logo frindly finance" />
                <h2>Não possuí uma conta? <Link to={'/cadastro'}>cadastre-se</Link></h2>
                <form onSubmit={handleLogin}>
                    <input 
                        type="email" 
                        placeholder="Email"
                        onChange={event => setEmail(event.target.value)}
                        value={email}
                    />
                    <input 
                        type="password" 
                        placeholder="Senha" 
                        onChange={event => setSenha(event.target.value)}
                        value={senha}
                    />
                    <Button className="button-login" type="submit">Login</Button>
                </form>
                
                
            </main>
        </div>
)
    }
